{
	"openapi": "3.0.2",
	"info": {
		"title": "Shri Property API Docs",
		"version": "2.2.2"
	},
	"servers": [{ "url": "https://dev.shriproperty.com/api", "description": "Development server" }],
	"components": {
		"securitySchemes": {
			"bearerAuth": {
				"type": "http",
				"scheme": "bearer",
				"bearerFormat": "JWT"
			}
		}
	},
	"security": [
		{
			"bearerAuth": []
		}
	],
	"paths": {
		"/otp/verify/{email}/{otp}": {
			"get": {
				"summary": "Verify OTP",
				"tags": ["OTP"],
				"externalDocs": {
					"description": "Postman",
					"url": "https://shriproperty.postman.co/workspace/Shriproperty~c878fae0-08d3-47eb-aecc-4e816a286c72/request/22823941-ce5f8114-a70c-4eb3-acd1-54211f480bb6"
				},
				"parameters": [
					{
						"in": "path",
						"name": "otp",
						"description": "OTP which was sent to user",
						"required": true,
						"schema": { "type": "number", "example": 1234 }
					},
					{
						"in": "path",
						"name": "email",
						"description": "Email on which OTP was sent",
						"required": true,
						"schema": { "type": "string", "example": "info@shriproperty.com" }
					}
				],
				"responses": {
					"200": {
						"description": "OTP was verified successfully",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"message": {
											"type": "string",
											"example": "OTP verified successfully"
										}
									}
								}
							}
						}
					},
					"400": {
						"description": "Any query is missing in the url",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Email is required"
										}
									}
								},
								"examples": {
									"Missing Email": {
										"value": {
											"error": "Email is required"
										}
									},
									"Missing OTP": {
										"value": {
											"error": "OTP is required"
										}
									}
								}
							}
						}
					}
				}
			}
		},
		"/otp/send": {
			"post": {
				"summary": "Send new otp to provided email",
				"tags": ["OTP"],
				"externalDocs": {
					"description": "Postman",
					"url": "https://shriproperty.postman.co/workspace/Shriproperty~c878fae0-08d3-47eb-aecc-4e816a286c72/request/22823941-7cf141d6-d8fb-412d-9db1-c691dfa7a70a"
				},
				"requestBody": {
					"required": true,
					"content": {
						"application/json": {
							"schema": {
								"type": "object",
								"properties": {
									"email": {
										"type": "string",
										"example": "info@shriproperty.com",
										"description": "Email on which otp will be sent"
									}
								},
								"required": ["email"]
							}
						}
					}
				},
				"responses": {
					"201": {
						"description": "OTP sent successfully",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"message": {
											"type": "string",
											"example": "OTP sent successfully"
										}
									}
								}
							}
						}
					},
					"400": {
						"description": "Email is not provided by the user",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Email is required"
										}
									}
								}
							}
						}
					},
					"422": {
						"description": "Email provided is invalid",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Email is invalid"
										}
									}
								}
							}
						}
					}
				}
			}
		},
		"/auth/signup": {
			"post": {
				"summary": "Signup user",
				"tags": ["Auth"],
				"externalDocs": {
					"description": "Postman",
					"url": "https://shriproperty.postman.co/workspace/Shriproperty~c878fae0-08d3-47eb-aecc-4e816a286c72/request/22823941-e80006d9-d245-43a7-8cae-18ac194006b3"
				},
				"requestBody": {
					"required": true,
					"content": {
						"application/json": {
							"schema": {
								"type": "object",
								"properties": {
									"name": {
										"type": "string",
										"example": "Shri Property",
										"description": "Name of the user"
									},
									"email": {
										"type": "string",
										"example": "info@shriproperty.com",
										"description": "Email of the user",
										"uniqueItems": true
									},
									"phone": {
										"type": "number",
										"example": 9465663009,
										"description": "Phone number of the user",
										"uniqueItems": true
									},
									"password": {
										"type": "string",
										"example": "somestrongpassword",
										"description": "Password of the user",
										"minLength": 4,
										"maxLength": 30
									},
									"cpassword": {
										"type": "string",
										"example": "somestrongpassword",
										"description": "confirmation that password is correct",
										"minLength": 4,
										"maxLength": 30
									}
								},
								"required": ["name", "email", "phone", "password", "cpassword"]
							}
						}
					}
				},
				"responses": {
					"201": {
						"description": "User created successfully and verification email is sent to the user",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"message": {
											"type": "string",
											"example": "User created successfully"
										}
									}
								}
							}
						}
					},
					"400": {
						"description": "Required field is missing",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "email is required"
										}
									}
								}
							}
						}
					},
					"401": {
						"description": "Password and cpassword does not match",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Password and confirm password do not match"
										}
									}
								}
							}
						}
					},
					"409": {
						"description": "User already exists",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "user with same email or phone already exists"
										}
									}
								}
							}
						}
					},
					"422": {
						"description": "Invalid email",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Invalid email"
										}
									}
								}
							}
						}
					}
				}
			}
		},
		"/auth/verify/{email}/{verificationCode}": {
			"get": {
				"summary": "Verify user",
				"description": "After signup a verification code will be sent on user email. this route is to verify that email",
				"tags": ["Auth"],
				"externalDocs": {
					"description": "Postman",
					"url": "https://shriproperty.postman.co/workspace/Shriproperty~c878fae0-08d3-47eb-aecc-4e816a286c72/request/22823941-cd65d8be-e14a-4946-973e-0fb8eed7bcf2"
				},
				"parameters": [
					{
						"in": "path",
						"name": "email",
						"description": "Email of the user on which verification code is sent",
						"required": true,
						"schema": {
							"type": "string",
							"example": "info@shriproperty.com"
						}
					},
					{
						"in": "path",
						"name": "verificationCode",
						"description": "Verification code sent on user email",
						"required": true,
						"schema": {
							"type": "string",
							"example": "rcSnXr_X6SbUCLF2T"
						}
					}
				],
				"responses": {
					"200": {
						"description": "User verified successfully or User already verified",
						"content": {
							"application/json": {
								"examples": {
									"User verified successfully": {
										"value": {
											"message": "User verified successfully"
										}
									},
									"User already verified": {
										"value": {
											"message": "User already verified"
										}
									}
								},
								"schema": {
									"type": "object",
									"properties": {
										"message": {
											"type": "string",
											"example": "User verified successfully"
										}
									}
								}
							}
						}
					},
					"404": {
						"description": "User not found",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "User not found"
										}
									}
								}
							}
						}
					}
				}
			}
		},
		"/auth/forgotpassword": {
			"post": {
				"summary": "Forgot password",
				"description": "Send password reset code to email",
				"tags": ["Auth"],
				"externalDocs": {
					"description": "Postman",
					"url": "https://shriproperty.postman.co/workspace/Shriproperty~c878fae0-08d3-47eb-aecc-4e816a286c72/request/22823941-cb5d08ed-2349-4089-94a5-0d1dc25139cc"
				},
				"requestBody": {
					"required": true,
					"content": {
						"application/json": {
							"schema": {
								"type": "object",
								"properties": {
									"email": {
										"type": "string",
										"example": "info@shriproperty.com",
										"description": "Email of the user"
									}
								}
							}
						}
					}
				},
				"responses": {
					"200": {
						"description": "Reset password link sent to user email",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"message": {
											"type": "string",
											"example": "Password verification code sent successfully to your email"
										}
									}
								}
							}
						}
					},
					"400": {
						"description": "Missing required field",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Missing required field"
										}
									}
								}
							}
						}
					},
					"404": {
						"description": "User not found",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "User not found"
										}
									}
								}
							}
						}
					},
					"422": {
						"description": "Invalid email",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Invalid email"
										}
									}
								}
							}
						}
					}
				}
			}
		},
		"/auth/resetpassword/{email}/{passwordResetCode}": {
			"patch": {
				"summary": "Reset password",
				"description": "Verify password reset code and reset password",
				"tags": ["Auth"],
				"externalDocs": {
					"description": "Postman",
					"url": "https://shriproperty.postman.co/workspace/Shriproperty~c878fae0-08d3-47eb-aecc-4e816a286c72/request/22823941-639beeb9-05b8-499d-9301-a9d8aca9bffe"
				},
				"parameters": [
					{
						"in": "path",
						"name": "email",
						"description": "Email of the user",
						"required": true,
						"schema": {
							"type": "string",
							"example": "info@shriproperty.com"
						}
					},
					{
						"in": "path",
						"name": "passwordResetCode",
						"description": "Password reset code",
						"required": true,
						"schema": {
							"type": "string",
							"example": "Ofdhh_6otRpWxecJyNsVs"
						}
					}
				],
				"requestBody": {
					"required": true,
					"content": {
						"application/json": {
							"schema": {
								"type": "object",
								"properties": {
									"password": {
										"type": "string",
										"example": "somestrongpassword",
										"description": "New password"
									},
									"cpassword": {
										"type": "string",
										"example": "somestrongpassword",
										"description": "Confirm new password"
									}
								}
							}
						}
					}
				},
				"responses": {
					"200": {
						"description": "Password reset successfully",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"message": {
											"type": "string",
											"example": "Password reset successfully"
										}
									}
								}
							}
						}
					},
					"400": {
						"description": "Missing required field",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Missing required field"
										}
									}
								}
							}
						}
					},
					"422": {
						"description": "Invalid email",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Invalid email"
										}
									}
								}
							}
						}
					},
					"404": {
						"description": "User not found",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "User not found"
										}
									}
								}
							}
						}
					},
					"401": {
						"description": "Passwords do not match",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Passwords do not match"
										}
									}
								}
							}
						}
					},
					"403": {
						"description": "Invalid password reset code",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"error": {
											"type": "string",
											"example": "Invalid password reset code"
										}
									}
								}
							}
						}
					}
				}
			}
		},
