		"/auth/me": {
			"get": {
				"summary": "Get current user",
				"tags": ["Auth"],
				"externalDocs": {
					"description": "Postman",
					"url": "https://shriproperty.postman.co/workspace/Shriproperty~c878fae0-08d3-47eb-aecc-4e816a286c72/request/22823941-ba3fd1e3-bc19-4707-85e6-dffac3ff4fbe"
				},
				"parameters": [
					{
						"in": "header",
						"name": "Authorization",
						"required": true,
						"description": "Access token from /auth/login",
						"schema": {
							"type": "string",
							"example": "Bearer eyJhbGciOiJSUzI1NiIsInR5cCI6IkpXVCJ9..f48iU6s9ND5Kxp00J0dWz7Mu67a1ZmsOtrWLR2subYMh8wtPYY4TWnVhGxWJhFPu67LYnKTU9bI6wUi6ZQcSHrRWi1r1VJBWPoIWMInNyTHNWNRQAR9vxBbwLrllfyo7tExZO1zdraOpgyQOven8VrXcEwhfVu5Lt9zO1S1CMiQ"
						}
					}
				],
				"responses": {
					"200": {
						"description": "User is logged in",
						"content": {
							"application/json": {
								"schema": {
									"type": "object",
									"properties": {
										"message": {
											"type": "string",
											"example": "User is logged in"
										},
										"user": {
											"type": "object",
											"properties": {
												"_id": {
													"type": "string",
													"example": "63106791ef47b9f3acb29792"
												},
												"name": {
													"type": "string",
													"example": "Shri Property"
												},
												"phone": {
													"type": "number",
													"example": 9465663009
												},
												"properties": {
													"type": "array",
													"example": [
														"63106791ef47b9f3acb29792",
														"63106791ef47b9f3acb29792"
													]
